import React from "react";

const modelos = [
  { id: 1, nombre: "Cortina Blackout", precio: 50, imagen: "blackout.jpg" },
  { id: 2, nombre: "Cortina Screen", precio: 60, imagen: "screen.jpg" },
  { id: 3, nombre: "Cortina Tradicional", precio: 40, imagen: "tradicional.jpg" },
];

const Catalog: React.FC = () => (
  <div style={{ maxWidth: 800, margin: "0 auto", padding: 20 }}>
    <h2>Modelos Prefabricados</h2>
    <div style={{ display: "flex", gap: 20 }}>
      {modelos.map((m) => (
        <div key={m.id} style={{ border: "1px solid #ccc", padding: 10, width: 180 }}>
          <img src={`/${m.imagen}`} alt={m.nombre} style={{ width: "100%" }} />
          <h3>{m.nombre}</h3>
          <p>Precio fijo: â‚¬{m.precio}</p>
        </div>
      ))}
    </div>
  </div>
);

export default Catalog;
